cmd-welcome-help:
Active un message qui sera envoyé lorsque des utilisateurs rejoindront le serveur.
Si vous spécifiez un url d'une image, ça cachera automatiquement le lien.
Dans vos messages, vous pouvez utlisez les mots clés suivants et ils seront remplacés :

@name : Le nom de l'utilisateur
@mention : mentionne l'utilisateur
@serv : Le nom du serveur
@id : L'ID de l'utilisateur
@number : Numéro de l'utilisateur

cmd-goodbye-help:
Active un message qui sera envoyé lorsque des utilisateurs quitteront le serveur.
Si vous spécifiez un url d'une image, ça cachera automatiquement le lien.
Dans vos messages, vous pouvez utlisez les mots clés suivants et ils seront remplacés :

@name : Le nom de l'utilisateur
@mention : Mentionne l'utilisateur
@serv : Le nom du serveur
@id : L'ID de l'utilisateur
@number : Nombre de membre sur le serveur
